import { Component } from '@angular/core';

@Component({
  selector: 'app-lista-ventas',
  templateUrl: './lista-ventas.component.html',
  styleUrls: ['./lista-ventas.component.css']
})
export class ListaVentasComponent {
  ventas: Ventas[] = [];

  constructor(private productoService: ProductosService, private listaProductosService: ListaProductoService) {

    this.productos = productoService.getListaProductos();

  }

}
